(65,	'USR-NDYSL-d386c',	0,	'0',	3,	NULL,	1134777600,	'Jl. Siliwangi No. 27',	'40131',	'Bandung',	'Jawa Barat',	'360',	'Student',	'Science',	'SMA Negeri 3 Bandung',	'+628112280901',	'_nanadidiyaya_',	'+628112000027',	'Parents (mother)',	'  Asthma',	'XL',	'-',	'- 1st place Women\'s Calligraphy Art Creativity Week and Expo Kecamatan Coblong 2016\n- 3rd place Women\'s Calligraphy Islamic Education for Elementary School Kecamatan Coblong 2017\n- 2nd place Solosfeel National Silat Championship Perisai Diri\n- 2nd place Women\'s Junior High School Singles Paku Bumi Open VIII Pencak Silat Championship\n- 1st place Women\'s Junior High School Singles Indonesian Pencak Silat Association Paku Bumi Open Virtual Pencak Silat Championship\n- 3rd place Women\'s Junior High School Singles Bandung Lautan Api Championship 3',	'My friends often said that I joined too many event committees. I\'m currently only in my 2nd year of high school but my week feels busy with all the meetings and events. I\'m currently on 3 events committees, one of which is the annual Festival Budaya that my school have every year. The other one is 3BUTES, which is a classical music concert that one of the extracurriculars does almost every year. Both of these events are open to the public, but we prioritize current students, teachers, alumni, and students\' families. The last one is a mentoring event that my school have for the 10th graders. The mentor and assistant mentor are us, 11th-12th graders and alumni. All of them are important to me and they teach me time management.',	'I always said that weaknesses are easier to see rather than strengths. Maybe it\'s because we\'re too cautious of what other people might think. We\'re too afraid to be seen as arrogant. But when I ask my family or friends, they would say that I\'m good at the arts. And they are not wrong. I love to draw, paint, sing, and dance. Essentially any art. I\'ve always loved them since I was just a kid. From my experiences, committees, and role models, I developed another skill, which is public speaking. I came to love speaking in front of people. Although the nervous side of me always took over before actually speaking. My third most recognizable talent, for me, is Perisai Diri. I have joined Perisai Diri for over 3 years and have won some competitions. Perisai Diri is a part of Pencak Silat, a part of martial arts.',	NULL,	NULL,	NULL,	NULL,	0,	0,	0,	'USR-NDYSL-d386c',	1667455461,	'USR-NDYSL-d386c',	1667526691,	0),
