(89,	'USR-STNRH-648b3',	0,	'0',	2,	NULL,	638323200,	'Jl.Kayu Manis Barat No.23 RT/RW 004/001',	'13130',	'East Jakarta ',	'DKI-Jakarta ',	'360',	'Manager domestic stakeholders and training ',	'Master of Science in Tropical Medicine and Infectious Diseases ',	'Binawan Foundation ',	'+6281283044454',	'https://www.instagram.com/reel/Cijmd69JBFx-POhfo4RTUIPhOUKRCXvX1ZY23g0/?igshid=YmMyMTA2M2Y=',	'+6287780032322',	'Cousin ',	'  I\'ve been infected by SARS-COV2 at 2020',	'M',	'Since I graduated from college, my career journeys have begun in a small area. It was approximately seven years as a Health Care Provider. It started in an academic field in 2014, which means I had been teaching in some SEKOLAH TINGGI ILMU KESEHATAN in Indonesia from 2014-2017. As an academician, my duty was to teach in a classroom. However, there were several tasks that we had to work on as a team to make a syllabus every semester, including a Memorandum of Understanding (MoU) to several stakeholders and conducting research. As a human being, I will never feel satisfied with fulfilling curiosity. However, I need to enhance my global knowledge and skills about the healthcare system. Such as non-communicable diseases, emerging re-emerging infectious diseases, neglected tropical diseases, and one-health. These are important during this pandemic crisis. Luckily, last 2017, I had an opportunity to work as a global professional as a Hemodialysis Nurse in KSA (Kingdom of Saudi Arabia). It was challenging. Having a job and living miles away from my home country was not as easy as I thought. I have learned many things from Diaverum Hemodialysis Global Company, such as how to handle patients based on policies and procedures, manage time well, and play the system carefully. Most importantly, it was about how to work as a team.\nOutside of my journey as a Nurse, I grew up in several organizations and joined a lot of seminar certifications and workshops. Recently, I am about to finish my thesis project with the topic \"Effect of Comorbidities on Mortality COVID-19 Patients \"to hold a Master\'s degree in Tropical Medicine and Infectious Diseases. For your further consideration, I would probably say about other skills that I have a talent in public speaking and English fluency. I am hard-working, ambitious, disciplined, and well prepared. Responsibilities:\n· Perform preliminary physical tests; take blood pressure, weight, and temperature; reporting patient history summary\n· Secure patient information and maintain patient confidence by completing and safeguarding medical records; completing diagnostic coding and procedure coding; keeping patient information confidential\n· and Joint Commission on Accreditation of Healthcare Organizations (JCAHO) standards\n· Update job knowledge by participating in educational opportunities, reading professional publications, maintaining personal networks, and participating in professional organizations\n· Enhance practice reputation by accepting ownership for accomplishing new and different requests and exploring opportunities to add value to job accomplishments\n \n',	'1. TRAVEL AWARD at JITMM (Joint International  Tropical Medicine Meeting) as speaker for Poster presentation \n2. Delegation of Model United Nation \n3. WHO Certification on  Implementation Research (IR) with a Focus on Infectious Disease of Poverty ',	'1.  Foods for Poverty in Jakarta \n2. Teaching \n3. Health Education ',	'1. Public Speaking \n2. Master of Ceremony \n3. Singing ',	NULL,	NULL,	NULL,	NULL,	0,	0,	0,	'USR-STNRH-648b3',	1667531764,	'USR-STNRH-648b3',	1667531808,	0),
