(109,	'USR-KMSHK-9b825',	0,	'-',	5,	'berkas/user/participans/6364fe1fafc37.jpeg',	1041267600,	'Palima,Kalihati',	'1975',	'Tangail',	'Dhaka ',	'50',	'Student ',	'Soica Science ',	'Bangladesh Army University of Engineering & Technology',	'+8801725412572',	'https://www.instagram.com/p/CgNRucrhESb/?igshid=YmMyMTA2M2Y=',	'+8801790971064',	'Father',	' -',	'L',	'I have already worked with the youth in the country and globally and was determined to see how the youth can be organized in the global arena and how the youth can play a role in nation building.\n\nGlobal Youth Leadership Summit 2021, Kathmandu, Nepal.\nKing\'s Leo Leadership Symposium 2021.\n2nd youth Eficiency E-couers -2021\nSAARC Youth Council 2020\nTraining WorkShop on Tour Guide Training- 2020\n2nd Community Based Scout Camp 2020\n11th National Rover Moot 2017, Bangladesh',	'????️????️????️My achievement for contributing in various fields....\n★ Hero of the Humanity, Lions Club International.\n★ Global Youth Leadership Award 2021\n★ National Service Award 2020 ( Bangladesh Scout ) .\n★ Mao Zedong Peace Award 2021\n★ APJ Abdul Kalam Youth Leadership Award 2022.\n★ Outstanding Leader Award 2022.',	'\"People are for people,\n  Life for life \"\n Embracing these moral values, I have been pursuing self-improvement along with human welfare for over a decade ...\n \n #️⃣#️⃣Alerts (2019-2020)\n\n 2nd January to 12 january , 2019: We have achieved great success in creating awareness about the proper use of the Bhuapur-Tangail highway by crossing the road with zebra-crossing and following the road rules and regulations.\n\n January 13, 2019: Justice Abu Saeed Chowdhury\'s invigorated Tangail has organized a variety of traditional Bengali rituals, embracing the culture of Bengal.\n\n February 21, 2019: With the celebration of International Mother Language Day, we organize various activities including drawing of children and teenagers competing in debates.\n\n On the occasion of the birth anniversary of Father of the Nation Bangabandhu Sheikh Mujib Rahman and National Children\'s Day on 16th March, the Tangail organization inspired by Justice Abu Saeed Chowdhury made food and educational materials for the street children with its own funds.\n\n\n 16th October 2019: Bangladesh \nRed-Crescent Society Tangail delegation encourages voluntary blood donation by diagnosing 250 high school students and 30 general public blood groups under the responsibility of conducting free blood group diagnosis program.\n\n\n The month of great victory is celebrated successfully from 1st December to 16th December by continuously carrying out various programs ...\n\n ???? 1st February 2020: Winter clothes were distributed among more than 100 families in Kangrangi Char.\n\n February 21, 2020: On the occasion of International Mother Language Day, more than 250 students from 13 educational institutions across Tangail were given quizzes, debates and education programs.\n March Various activities were undertaken on the occasion of the centenary of the birth of the great freedom fighter on 16th March 2020-2021 (distribution of food among wild animals, tree planting, book fair, math competition, newspaper olympics etc., Bangabandhu Medhaunmesh (ongoing))\n\n ???? April 17, 2020: The public is encouraged and rallied to get rid of all types of plastic bags used and inferior.\n\n August 4, 2020: Various co-operation activities are undertaken for coronavirus patients.  So far 1000 families have received assistance.\n\n November 6, 2020: We are able to implement various initiatives including the distribution of free masks with the theme \"No Mask, No Service\".  Above all, welfare is our vow of eternal welfare.',	'The youth will play a leading role in building a prosperous world and a prosperous nation. In order to make developing countries a nation, young people need to be involved in this conference.\nI have been leading various youth organizations for the last four years as a contribution in various sectors and in this continuity I have been honored and added to my honor basket.\n★Founder, Justice Abu Sayeed Chowdhury Foundation.\n★Representative, Messenger of Peace  & Scout Member, world organization of the scout movement.\n★ Chief IT Coordinator, Global youth Parliament \n★ President, Volunteers for Bangladesh, Tangail District.',	'Facebook',	'https://www.facebook.com/289087467776593/posts/pfbid02PNnZTnbYMAAMfd8bqfLCTABCsXpM4J5wU8BKS6G4sZqcuo6EcJkuBuPZNKUDhkyTl/',	'https://twb.nz/middleeastyouthsummit',	'https://twb.nz/middleeastyouthsummit',	0,	0,	0,	'USR-KMSHK-9b825',	1667554951,	'USR-KMSHK-9b825',	1667563039,	0),
