iness to 9/10 years old kids, I participated in the program \"Kid-Entrepreneur\", which was at the house of sciences, Oujda. I also participated on the local science festival and succeed on reaching 1000 kids.\nEnactus is an international social entrepreneurship organization, therefore, at Enactus FLSHO and as vice Project Manager, I have helped ambitious students with project ideas that impact their community and environment, to develop their ideas, create their own companies, and participate in the market.',	'Extremely motivated to constantly develop my skills and evolve\nprofessionally. Passionate and determined, I invest myself 100% in everything I do because I like to learn, take up challenges and surpass myself.\nLooking to utilize my technology and leadership skills in an esteemed organization. Well-versed in project management skills. Tech-savvy and a fast learner with innate communication skills and a natural curiosity for entrepreneurship.\nPeople always tell me that I was born to be a leader, I have confidence in my leadership skills, in addition to my communication skills and emotional intelligence, I also have great public speaking skills and I work always with teams that have helped me develop my teamwork skills, I am very flexible and calm in the face of difficult situations, and finally I always focus on leaving my creative touch',	NULL,	NULL,	NULL,	NULL,	0,	0,	0,	'USR-LDDNM-dc164',	1667596382,	'USR-LDDNM-dc164',	1667596807,	0),
