(121,	'USR-MHMDQ-37c92',	0,	'0',	3,	NULL,	1177174800,	'Jl Gn Lawu IV No.170',	'45141',	'Cirebon',	'West Java',	'8',	'Student',	'-',	'Kızılcahamam Anadolu Imam Hatip',	'6282120375679',	'iqbalamrr_',	'081212919041',	'Sister',	' -',	'L',	'- Student Literacy Minister (OSIS)\n- President of Student Council\n- PIC Robotic - Saintek\n- Public Relation Officer (KAPMI DKI)\n- Head of MAD (IMC)\n- CTO (Maloka Foundation)\n- CTO (Indonesian Youth Agent)\n- General Secretary (TalksZone)\n- CEO (Teras Pemimpin)\n- Marketing Volunteer of Milleniartfest',	'- The best Santri in Dormitory (Binsan Award 2020)\n- Student of the year, The best achievements in Biology and ICT (NFBS Awards 2021)\n- The best Achievement in Chemistry (NFBS Awards 2022)\n- Student of the Year in Batch 3 \n- 1st place Cerdas Cermat (Dynamics Lite)\n- Bronze Medal Natural Science PISA 2021\n- Bronze Medal English PISA 2021\n- Gold Medal ICS 2021\n- The best achiever in Tahfidz (Binsan Award 2021)\n- The best santri in Kitab (Binsan Award 2021)\n- The best santri in Qiyamullail (Binsan Award 2022\n- Lomba robotik nasional (KRON 2019)\n- Silver Medal in Indonesian Olympiad (2021)\n- First Place Kresna Speech Competition 2022\n',	'- Gerakan Jakarta Mengabdi (JM)\n- Berbagu Ramadhan (ACT)',	'Programming\nPhotography \nPublic Speaking\nLeadership ',	NULL,	NULL,	NULL,	NULL,	0,	0,	0,	'USR-MHMDQ-37c92',	1667622081,	'USR-MHMDQ-37c92',	1667622360,	0),
(122,	'USR-BDLHF-ed53d',	0,	'',	5,	'berkas/user/participans/63662fc3a17ff.jpeg',	704998800,	'8-32-9 second floor, TAMIL STREE, CHINNA WALTAIR VISAKHAPATNAM, ANDHRA PRADESH,',	'530017',	'Visakhapatnam',	'Visakhapatnam',	'729',	'Master of pharmacy ',	'Pharmacy ',	'Andhra University ',	'+917708354986',	'Abbelhafiz',	'+918309407543',	'Cousin ',	'   History is the study of change over time, and it covers all aspects of human society. Political, \nsocial, economic, scientific, technological, medical, cultural, intellectual, religious and military \ndevelopments are all part of history. Usually professional historians specialize in a particular aspect of \nhistory, a specific time period, a certain approach to history or a specific geographic region. \nNon-historians often say that “history repeats itself” or that “things were always this way.” History \ncannot repeat itself because history is not a living, thinking being. History is an intellectual discipline\npracticed by historians who try to make sense of the past. Because history is about change, nothing was \never “always” a certain way.\nNon-historians often romanticize the past and speak of the “good old days” when they believe \nthat things were generally better than at present. Conversely, some see history exclusively as a story of \nprogress with everything constantly improving. People of all eras have made great achievements and \ncommitted terrible blunders; so processes of historical change cannot be categorized as either simple \nprogress or regression. Historical processes involve complex relations between interrelated factors.\nNon-historians derive information mainly from television, movies, and the internet as well as some \nbooks or magazines. They generally accept any sources uncritically as long as the source is interesting. \nHistorians know that all sources, even those original to a particular historical time period, have some \nbiases, omissions, contradictions, or various other limitations. That does not mean that such sources are \ncompletely invalid and useless; rather it means that historians have to know and study much to recognize \nthe strengths and weaknesses of different sources. \nHistorians who write history emphasize the value of primary sources, that is those sources \nactually dating from a particular time period, while understanding the limitations of such sources. Non-\nhistorians read books or watch documentaries, while historians do that plus go to archives in search of \noriginal records. [Historians who study non-English speaking regions must learn and use foreign \nlanguages.] \nHistorians who write list all the sources that they have used in footnotes and bibliographies in \ntheir works. This helps other scholars who are interested to find those sources, and it shows that the \nwriter is careful, thorough, and honestly giving credit for the origin of the writer’s information. Providing \nfootnotes and a bibliography is how historians demonstrate their methodology and support their \nconclusions.\nNon-historians assume that historians have always approached history the same way. Historians \nknow that the philosophy and methodology of history have changed over time and will keep changing. \nMany different interpretations of all historical topics exist. Historians must work to recognize the difference \nbetween facts and interpretations in their field. Historiography refers to the history, philosophy and \nmethodology of history. Historians must be familiar with the historiography of their particular area of study.\nNon-historians often make broad generalizations about people, ideas, events, or time periods in \nhistory. Historians tend to focus more on the specific, detailed developments that underpin the \ngeneralizations, and sometimes question or reject the generalizations themselves.\nNon-historians may assume that time periods are fixed and absolute, whereas historians have \nvarious ways of organizing history thematically and chronologically. Periodization, to historians, is just a \nconvenient form of broad organization, especially useful for course listings in university catalogs and \nsubject headings in library catalogs.\nNo historian can be 100% objective, but historians try to recognize their own limitations and \nbiases. Historians try not to place the values, beliefs, behaviors, and attitudes of the present onto the \ntopics they study. Historians try to understand their topics in the context of how and why people of that \nera thought and behaved, and not how people think and act today.',	'L',	'2 years experience as a community pharmacist ',	'Team leader and pharmacy manager ',	'UNHCR project for refugees ',	'Drawing and football ',	'Friends',	'Ahmed',	'http://middleeastyouthsummit.com/user/submission',	'http://middleeastyouthsummit.com/user/submission',	0,	0,	0,	'USR-BDLHF-ed53d',	1667641683,	'USR-BDLHF-ed53d',	1667641693,	0),
