(174,	125,	'USR-HLMTN-ab2a5',	3,	'What have you done to empower the Muslim community around you?',	'I make sure that people around me understand the deep reason of why and how things are done so their curiosity is tamed and they are at peace with themselves. I help people talk about mental problems.',	0),
(175,	126,	'USR-MHMMD-8f501',	1,	'In your view, what are the main problems of the world\'s Muslim community today? why?',	'Muslim Community is divided sad to say, we are not together as one and have been divided unlike the west which is strong because they are united.',	0),
(176,	126,	'USR-MHMMD-8f501',	2,	'What o you think is the solution to the problem?',	'Learn to accept each other and join hands together to stay united.',	0),
(177,	126,	'USR-MHMMD-8f501',	3,	'What have you done to empower the Muslim community around you?',	'Tell people why we as muslims are way behind than west, and how we can compete at their level.',	0),
(178,	127,	'USR-SLSBL-2e40b',	1,	'In your view, what are the main problems of the world\'s Muslim community today? why?',	'-',	0),
(179,	127,	'USR-SLSBL-2e40b',	2,	'What o you think is the solution to the problem?',	'-',	0),
(180,	127,	'USR-SLSBL-2e40b',	3,	'What have you done to empower the Muslim community around you?',	'-',	0),
(181,	130,	'USR-RHYKR-b1e52',	1,	'In your view, what are the main problems of the world\'s Muslim community today? why?',	'With the globalization, it\'s easy to get many information. But sometimes, there are many fake information. Besides that, the main problem is the muslims it self, we slowly lose our identity.',	0),
(182,	130,	'USR-RHYKR-b1e52',	2,	'What o you think is the solution to the problem?',	'More faith and education ',	0),
(183,	130,	'USR-RHYKR-b1e52',	3,	'What have you done to empower the Muslim community around you?',	'Just remindering some of my friend when it\'s time to shalat.',	0);
